import React, { useState } from 'react';
import axios from 'axios';

export default function Result() {
    const [postData, setPostData] = useState([]);

    const handleGetData = async () => {
        try {
            const response = await axios.get('http://43.202.79.6:3001/result?paperId=2');
            const responseBody = JSON.parse(response.data.body); // 문자열을 객체로 파싱
            const extractedData = responseBody.map(item => item.body); // body 속성 값만 추출하여 배열로 저장
            setPostData(extractedData);
        } catch (error) {
            console.error('Error fetching data:', error);
        }
    };

    return (
        <div>
            <h2>포스트 결과 종합</h2>
            <button onClick={handleGetData}>내 자료 가져오기</button>

            {/* 받아온 데이터를 출력 */}
            {postData.length > 0 && (
                <div>
                    <h3>서버에서 받아온 데이터의 body 값:</h3>
                    <ul>
                        {postData.map((body, index) => (
                            <li key={index}>{body}</li>
                        ))}
                    </ul>
                </div>
            )}
        </div>
    );
}
